import React, {Component} from 'react';
import { connect} from 'react-redux';
import './index.css';
import axios from 'axios';
import {getEmittedOrder} from './getEmittedOrder';
import {fetchAllOrders} from './actions/fetchAllOrders';








class WaiterView extends React.Component {
  constructor(){
    super();

  
   
    }
componentDidMount(){

  getEmittedOrder();
}


  render(){

    let ordersList = this.props.orders.map((item, index) =>{

      return <li className="" key={index}>{item.name}<span className=""></span><span className=""> {item.price} kn</span></li>
    });
   
    return (
    <div className="checkOutMain">
    <h2>New orders</h2>
    <ul>
        {ordersList}

    </ul>
    </div>
  );
    }
}

const mapStateToProps = (state) =>{

    return{
       
        
      orders:state.orders
  
  
      
    }
  
  }
const mapDispatchToProps = (dispatch) =>{

  return{
        
       
    fetchAllDrinks: () =>{dispatch(fetchAlcoholicDrinks())},

    


      

  }
}



export default connect(mapStateToProps, mapDispatchToProps)(WaiterView);
